import { React } from "react";
import { GlobalStyle } from "./globalStyles";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { Navbar } from "./components/navbar/Navbar";

function App() {
  return (
    <Router>
      <Switch>
        <Route>
          <Navbar />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
